Information
------------------------------

Taboo: Changing Sex
Sometimes defining one's gender isn't easy. Ashley and Tony are happily married, however, when they first met and fell in love, Ashley was a man...and Tony was a woman. Chris Tina Bruce calls herself a hybrid - neither male nor female as part of a gender revolution known as &quot;Gender Queer&quot; or &quot;Gender Fuzzy&quot;. Balian is athletic, masculine and would give most male models a run for their money except for one thing - he used to be a woman.

